import { Component, OnInit } from '@angular/core';
import { VendorUpdateComponent } from 'app/entities/vendor';

@Component({
    selector: 'jhi-vendor-extended-update',
    templateUrl: './vendor-extended-update.component.html'
})
export class VendorExtendedUpdateComponent extends VendorUpdateComponent {}
